import { LoadScript, GoogleMap, Marker } from '@react-google-maps/api';
import { useState } from 'react';

export default function GoogleMapsApi() {

    const [setMark, mark] = useState([0, 0]);

    function handleMapClick(event: Marker) {
        setMark(event.marker?.getPosition)
    }

    const center = { lat: 48.8584, lng: 2.2945 }

        return(
        <LoadScript googleMapsApiKey = "AIzaSyA_WC7fO9PYuaWNHV4Bg5nw_Q_O6VLzLfo" >
                <GoogleMap
                    center={center}
                    zoom={15}
                    mapContainerStyle={{ width: '500px', height: '500px' }}
                >
                    <Marker position={handleMapClick}/>
                </GoogleMap>
        </LoadScript >
    )
}
